            <select className="form-control">
                <option>Seçiniz</option>
                <option>Cari 1</option>
                <option>Cari 2</option>
                </select>
        </div>
        </div>
        <hr></hr>
        <div className="row">
        <div className="col-4">
                <h5>Cari Adı:</h5>
                <h5>Cari Kodu:</h5>
                <h5>Cari Telefon:</h5>
                
            </div>
      </div>
        
    </div>
  );
};

export default tahsilat;
